import React from 'react'

const SettingPage: React.FC = () => {
    return (
        <div
            style={{
                backgroundColor: "rgba(132, 0, 0, 0.9)",
                height: "100vh",
                backgroundSize: "cover",
                backgroundRepeat: "no-repeat",
                backgroundPosition: "center",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                position: "relative",
            }}>
            <h1>SettingPage</h1>
        </div>
    )
}

export default SettingPage
